INSERT INTO `beritas` (`id`, `title`, `slug`, `content`, `image`, `is_published`, `published_at`, `created_at`, `updated_at`) VALUES
(1, 'Dindik Jatim Dorong Sertifikasi Kompetensi bagi Murid Vokasi', 'dindik-jatim-dorong-sertifikasi-kompetensi-bagi-murid-vokasi', '<p>Surabaya (beritajatim.com) – Dinas Pendidikan Jawa Timur (Dindik Jatim) terus mendorong peningkatan kompetensi siswa vokasi melalui pelatihan dan sertifikasi. Selama setahun, pelatihan digelar enam kali oleh UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) Dindik Jatim, menggandeng Lembaga Sertifikasi Kompetensi (LKS) Dirjen Vokasi Kemendikdasmen.&nbsp;<br><br></p><p>Kepala Dindik Jatim Aries Agung Paewai menekankan pentingnya sertifikasi bagi lulusan vokasi yang belum memiliki fasilitas praktik memadai. “Harapan kita kalau bisa seluruh lulusan vokasi memiliki pengakuan atau sertifikasi atas kompetensi mereka,” ujarnya, Jumat (8/8/2025). Ia menambahkan, pelatihan melibatkan praktisi dunia usaha dan industri agar materi yang diberikan sesuai kebutuhan lapangan. “Kita prioritaskan bagi murid yang belum mendapatkan ilmu di satuan pendidikan,” tegasnya.&nbsp;</p><p>Pada semester kedua ini, UPT PTKK menggelar pelatihan untuk kelas Milenial Job Center (MJC) angkatan 2 yang berlangsung 31 Juli-5 Agustus 2025.&nbsp;</p><p>Kepala UPT PTKK Endang Winarsih menjelaskan, peserta kelas MJC dibekali keterampilan bidang TI seperti pemrograman, pengembangan web/mobile, serta Desain Web, Desain Grafis, Animasi, Fotografi, dan Videografi. “Kita harapkan peserta memiliki motivasi untuk berinovasi dan melihat peluang dalam menciptakan solusi digital,” kata Endang. Ia menegaskan pentingnya membangun ekosistem pendidikan vokasi yang adaptif dan kompetitif.&nbsp;</p><p>Setiap kelas diikuti 15 peserta. Sertifikasi menjadi bagian dari capaian akhir pelatihan. “Seluruh murid juga mendapatkan pengakuan atas skill mereka,” pungkas Endang.<strong>&nbsp;</strong></p>', 'konten-website/berita/thumbnail/01KCQY7MGG2Z0N5QE3WDAKXKJ1.png', 1, '2025-08-08 07:54:00', '2025-12-18 01:30:25', '2025-12-18 12:16:58'),
(2, 'Tingkatkan Keahlian Siswa Double Track, SMAN 1 Soko Tuban Kunjungan Kerja ke UPT PTKK', 'tingkatkan-keahlian-siswa-double-track-sman-1-soko-tuban-kunjungan-kerja-ke-upt-ptkk', '<p>KETIK, SURABAYA – Tim manajemen SMAN 1 Soko Tuban melaksanakan kunjungan kerja sama strategis ke Unit Pelaksana Teknis (UPT) Pengembangan Teknis dan Keterampilan Kejuruan (PTKK) Dinas Pendidikan Jawa Timur di Surabaya, 23 Oktober 2025.<br><br>Kegiatan ini dalam rangka memperkuat dan meningkatkan keahlian siswa yang tergabung dalam program Double Track. Kunjungan ini disambut hangat pihak UPT PTKK yang menandakan sinergi positif dalam pengembangan keterampilan vokasional siswa.<br><br>Tim SMAN 1 Soko disambut langsung Kepala Seksi Pengembangan Teknis UPT PTKK, Nur Khotimah, S.Pd., M.M. Dia didampingi jajarannya. Dalam suasana yang sangat ramah, tim SMAN 1 Soko menyampaikan maksud dan tujuan kunjungan yaitu menjalin kerja sama demi memastikan siswa Double Track mendapatkan pelatihan terbaik yang relevan dengan kebutuhan industri.<br><br>Setelah pemaparan, tim SMAN 1 Soko diajak meninjau fasilitas praktik/laboratorium yang dimiliki UPT PTKK. Laboratorium yang dikunjungi sangat beragam dan lengkap, mencakup keahlian teknis dan kreatif, di antaranya Laboratorium Pengelasan, Laboratorium Teknik Otomotif, Laboratorium Teknik Pendingin, dan Laboratorium Tata Boga.<br><br>Ada juga Laboratorium Tata Busana, Laboratorium Tata Kecantikan, Laboratorium Desain Web, Laboratorium Fotografi, Laboratorium Videografi, Laboratorium Desain Grafis, hingga Laboratorium Teknik Pemesinan.<br><br>Selain fasilitas praktik, tim juga ditunjukkan sarana pendukung lain seperti asrama, Hotel Q ta, musholla, serta ruang ramah tamah dan ruang makan yang representatif.<br>Nur Khotimah dan tim UPT PTKK memberikan wawasan mendalam mengenai kesiapan UPT PTKK dalam mendukung peningkatan keterampilan siswa SMAN 1 Soko.<br><br>\"Kami sangat terbuka dan antusias menyambut niat baik SMAN 1 Soko. Kerja sama ini adalah wujud nyata komitmen kami dalam peningkatan sumber daya manusia,” ucap Nur Khotimah.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:386187,&quot;height&quot;:375,&quot;href&quot;:&quot;https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png&quot;,&quot;url&quot;:&quot;https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png\"><img src=\"https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png\" width=\"600\" height=\"375\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">377.14 KB</span></figcaption></a></figure><br>“Kami sudah memiliki berbagai fasilitas laboratorium yang mumpuni, dan yang terpenting, kami siap mendukung pengembangan keterampilan siswa melalui Program Mobile Training Unit (MTU) yang bisa langsung \'menjemput bola\' ke sekolah, memastikan siswa SMAN 1 Soko mendapatkan bekal keahlian yang relevan dan siap kerja,\" tambahnya.<br><br>Salah satu poin penting yang disampaikan adalah adanya program Mobile Training Unit (MTU) yang siap diterjunkan langsung ke sekolah untuk memberikan pelatihan keterampilan kepada siswa.<br><br>Program ini menjadi solusi efektif dalam mendekatkan akses pelatihan vokasi berkualitas.<br><br>​\"Kunjungan ke UPT TPKK ini sangat berharga. Kami terkesan dengan kelengkapan fasilitas, mulai dari laboratorium pengelasan, teknik otomotif, hingga tata boga dan desain grafis. Melihat kesiapan dan keramahan tim UPT TPKK, terutama dengan adanya tawaran program MTU, kami semakin yakin bahwa sinergi ini akan menjadi lompatan besar bagi program Double Track SMAN 1 Soko dalam mencetak lulusan yang benar-benar terampil, kompeten, dan siap bersaing di dunia kerja maupun wirausaha,\" jelas Sumarni, SP., M.Pd Kepala SMAN 1 Soko.<br><br>Kerja sama ini diharapkan akan memberikan dampak signifikan terhadap kualitas lulusan program Double Track SMAN 1 Soko, sekaligus menjadikan siswa tidak hanya unggul secara akademik namun juga memiliki keterampilan yang matang dan siap kerja atau berwirausaha sesuai tuntutan zaman. (*)<br><br></p>', 'konten-website/berita/thumbnail/01KCQHK07X5KMRZHGZT3BY90TY.jpg', 1, '2025-10-27 16:50:00', '2025-12-18 01:36:00', '2025-12-18 01:39:31'),
(3, 'Dinas Pendidikan Jatim Atasi Keterbatasan Alat Praktik Sekolah dengan Program Mobile Training Unit', 'dinas-pendidikan-jatim-atasi-keterbatasan-alat-praktik-sekolah-dengan-program-mobile-training-unit', '<p>Dinas Pendidikan (Dindik) Provinsi Jawa Timur melalui UPT Pengembangan Teknis dan Keterampilan Kejuruan (PTKK) memberi pelatihan kompetensi murid di Jatim lewat <em>Mobile Training Unit</em> (MTU), dengan menyasar sekolah yang belum memiliki alat praktik mumpuni, pada 22-27 September 2025.</p><p>Aries Agung Paewai Kepala Dindik Jatim menyatakan, MTU menyasar 150 murid yang tersebar di 5 cabang dinas pendidikan (cabdindik) wilayah yang ada di Jawa Timur, seperti Malang, Magetan, Kediri, Tuban, dan Nganjuk.</p><p>Kompetensi keahlian yang diajarkan adalah Programmable Logic Controller (PLC), Teknik Pendingin dan Tata Udara (TPTU), Videografi, dan Fotografi.</p><p>“Kesempatan ini bisa dimanfaatkan untuk mengimplikasikan dari materi teori akademik dengan prakteknya. Sehingga, kompetensi yang belum dimiliki murid kita, bisa terpenuhi,” katanya, Selasa (23/9/2025).</p><p>Aries mengatakan, program MTU menjadi salah satu solusi di tengah banyaknya SMK di Jatim yang memiliki keterbatasan pada sarana prasarana praktek, terutama pada kompetensi tertentu.</p><p>Dengan langkah tersbeut, pihaknya ingin agar kompetensi murid bisa sesuai dengan standart Dunia Usaha Dunia Industri (DUDI).</p><p>Pihaknya mengakui, program tersbeut masih terbatas dalam jumlah instruktur profesional untuk memberikan pelatihan, apalagi jumlah SMK Negeri di Jatim mencapai 298 lembaga, sedangkan banyak alat praktek di sekolah belum mumpuni. Oleh karena itu, program MTU sifatnya bergilir.</p><p>“Setiap pelepasan MTU ada 5 wilayah dengan 4 kompetensi yang ada kita harapkan mencapai sasaran yang ada. Seandainya punya banyak (MTU dan instruktur profesional) mungkin bisa menjamah 38 kabupatebn kota. Sedangkan tahun ini kita jangkau 15 kabupaten kota prada program ini,” ucapnya.</p><p>Dindik Jatim berencana, ke depan program MTU dengan empat kompetensi akan dipusatkan di satu Cabdindik wilayah agar pelatihan kompetensi bisa maksimal dan dan merata.</p><p>“Program ini kami harapkan dapat memberikan manfaat signifikan bagi para murid-murid sehingga akan berdampak besar pada kompetensi murid,” tuturnya.</p><p>Endang Winarsih Kepala UPT PTKK menambaghkan bahwa dalam MTU, Dindik tidak hanya memberikan pelatihan teknis, tetapi juga menghadirkan pengalaman praktis yang bisa menumbuhkan motivasi, inspirasi, serta mendorong kreativitas dan kemandirian siswa, agar lebih siap menghadapi tantangan dunia usaha dan dunia industri.</p><p>“Peserta kita bukan hanya dari SMK negeri yang kita tunjuk sebagai tempat pelatihan, tapi peserta berasal dari sekitar sekolah yang memang sangat membutuhkan peningkatan kompetensi,” jelasnya.</p><p>Seperti diketahui, titik pelatihan tersebut dipusatkan di beberapa sekolah, yakni SMKN 12 Malang, SMKN 1 Magetan, SMKN 1 Kediri, SMKN 3 Tuban, dan SMKN 1 Nganjuk.</p><p>Setiap Cabdin menjadi tuan rumah bagi 30 peserta didik dengan empat bidang kompetensi, mulai dari PLC, TPTU, videografi dan fotografi.</p>', 'konten-website/berita/thumbnail/01KCQHPZBBJYE06K3REWP56DYQ.jpg', 1, '2025-09-23 13:40:00', '2025-12-18 01:38:09', '2025-12-18 12:17:25'),
(4, 'Dindik Jatim Genjot Pelatihan Vokasi demi Cetak Lulusan Siap Kerja', 'dindik-jatim-genjot-pelatihan-vokasi-demi-cetak-lulusan-siap-kerja', '<p>jatim.jpnn.com, SURABAYA - Dinas Pendidikan Jatim terus menggenjot peningkatan kompetensi siswa dan guru SMK melalui pelatihan vokasi berskala besar. Dalam setahun, UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) menggelar enam kali pelatihan yang menyasar siswa dan guru produktif. Pelatihan ini menggandeng Lembaga Sertifikasi Kompetensi (LSK) dari Ditjen Vokasi Kemendikdasmen. Tujuannya untuk mencetak lulusan vokasi yang terampil, bersertifikasi, dan siap bersaing di dunia kerja maupun dunia industri (DUDI). Kepala Dindik Jatim Aries Agung Paewai mengatakan pelatihan intensif ini menjadi tolok ukur keterampilan siswa. Apalagi peserta dibimbing langsung oleh para praktisi industri dan ahli di bidangnya.</p><p>\"Harapan kami kalau bisa seluruh lulusan vokasi utamanya yang belum memiliki fasilitas bengkel praktek yang memadai bisa memiliki pengakuan atau sertifikasi atas kompetensi mereka karena ke depan, industri akan berkembang pesat seiring dengan berkembangnya teknologi,\" ujar Aries, Kamis (7/8). Dia menambahkan, sertifikasi ini penting agar lulusan vokasi memiliki daya saing, terutama menghadapi perkembangan industri dan teknologi yang terus melaju cepat. “Kita prioritaskan peserta dari sekolah yang belum punya sarpras lengkap atau belum tersentuh keterampilan sesuai kebutuhan industri. Di sinilah peran pelatihan vokasi sebagai jembatan,\" katanya.<br><br>Sementara itu, Kepala UPT PTKK Dindik Jatim Endang Winarsih menjelaskan pelatihan semester kedua ini difokuskan pada kelas Milenial Job Center (MJC) Angkatan 2 Tahun 2025 yang digelar pada 31 Juli–5 Agustus. Kelas MJC dirancang untuk siswa SMA/SMK yang memiliki dasar kemampuan di bidang pemrograman, pengembangan aplikasi web atau mobile, hingga teknologi informasi lainnya.<br>\"Peserta didorong agar mampu berinovasi dan melihat peluang menciptakan solusi digital. Harapannya mereka tak hanya siap kerja, tetapi juga bisa menjadi wirausahawan,\" jelas Endang.<br>Menurut dia, pelatihan ini juga menjadi bagian dari upaya membentuk ekosistem pendidikan vokasi yang adaptif, terstandar, dan kompetitif menuju Generasi Emas 2045. Adapun bidang keterampilan yang diajarkan dalam pelatihan MJC Reguler Angkatan 2 ini meliputi Desain Web, Desain Grafis, Motion Graphic, Animasi, Fotografi, dan Videografi. Setiap kelas diikuti 15 peserta. \"Melalui pelatihan ini, kami harapkan murid-murid bisa mendapat sertifikasi yang mengakui keahlian mereka. Itulah target akhir pelatihan vokasi,\" pungkas Endang. (mcr12/jpnn)<br><br></p>', 'konten-website/berita/thumbnail/01KCQHYFSQGYE8FV3JBPWXMDR1.jpg', 1, '2025-08-07 18:40:00', '2025-12-18 01:42:15', '2025-12-18 01:42:15'),
