('upt_ptkk_cache_kepala_upt', 'O:20:\"App\\Models\\KepalaUpt\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:11:\"kepala_upts\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:6:{s:2:\"id\";i:1;s:15:\"nama_kepala_upt\";s:28:\"ENDANG WINARSIH, S.SOS, M.SI\";s:4:\"foto\";s:56:\"konten-website/kepala-upt/01KCT30TP6SN8JVKETCTNVKZA4.png\";s:8:\"sambutan\";s:912:\"<p>Puji syukur ke hadirat Tuhan Yang Maha Esa atas limpahan rahmat-Nya sehingga UPT PTKK dapat melaksanakan setiap program pelatihan dengan baik. Program pelatihan kami disusun sebagai wujud nyata komitmen UPT PTKK dalam mendukung kebijakan Merdeka Belajar dan perubahan paradigma pendidikan vokasi agar selaras dengan kebutuhan industri,&nbsp; khususnya dalam meningkatkan kompetensi guru dan siswa di pendidikan kejuruan Jawa Timur.<br><br>Kami menyadari bahwa pencapaian tujuan besar ini tidak dapat terwujud tanpa kerja sama dan dukungan dari berbagai pihak, baik internal Dinas Pendidikan maupun eksternal. Untuk itu, kami mengucapkan terima kasih atas segala bentuk dukungan dan kontribusi yang telah diberikan. Semoga program pelatihan kami dapat menjadi landasan kuat dalam menciptakan SDM vokasi yang unggul, adaptif, kompetitif serta mampu membawa pendidikan kejuruan Jawa Timur semakin maju.&nbsp;</p>\";s:10:\"created_at\";s:19:\"2025-12-18 01:24:15\";s:10:\"updated_at\";s:19:\"2025-12-19 08:19:06\";}s:11:\"\0*\0original\";a:6:{s:2:\"id\";i:1;s:15:\"nama_kepala_upt\";s:28:\"ENDANG WINARSIH, S.SOS, M.SI\";s:4:\"foto\";s:56:\"konten-website/kepala-upt/01KCT30TP6SN8JVKETCTNVKZA4.png\";s:8:\"sambutan\";s:912:\"<p>Puji syukur ke hadirat Tuhan Yang Maha Esa atas limpahan rahmat-Nya sehingga UPT PTKK dapat melaksanakan setiap program pelatihan dengan baik. Program pelatihan kami disusun sebagai wujud nyata komitmen UPT PTKK dalam mendukung kebijakan Merdeka Belajar dan perubahan paradigma pendidikan vokasi agar selaras dengan kebutuhan industri,&nbsp; khususnya dalam meningkatkan kompetensi guru dan siswa di pendidikan kejuruan Jawa Timur.<br><br>Kami menyadari bahwa pencapaian tujuan besar ini tidak dapat terwujud tanpa kerja sama dan dukungan dari berbagai pihak, baik internal Dinas Pendidikan maupun eksternal. Untuk itu, kami mengucapkan terima kasih atas segala bentuk dukungan dan kontribusi yang telah diberikan. Semoga program pelatihan kami dapat menjadi landasan kuat dalam menciptakan SDM vokasi yang unggul, adaptif, kompetitif serta mampu membawa pendidikan kejuruan Jawa Timur semakin maju.&nbsp;</p>\";s:10:\"created_at\";s:19:\"2025-12-18 01:24:15\";s:10:\"updated_at\";s:19:\"2025-12-19 08:19:06\";}s:10:\"\0*\0changes\";a:0:{}s:11:\"\0*\0previous\";a:0:{}s:8:\"\0*\0casts\";a:0:{}s:17:\"\0*\0classCastCache\";a:0:{}s:21:\"\0*\0attributeCastCache\";a:0:{}s:13:\"\0*\0dateFormat\";N;s:10:\"\0*\0appends\";a:0:{}s:19:\"\0*\0dispatchesEvents\";a:0:{}s:14:\"\0*\0observables\";a:0:{}s:12:\"\0*\0relations\";a:0:{}s:10:\"\0*\0touches\";a:0:{}s:27:\"\0*\0relationAutoloadCallback\";N;s:26:\"\0*\0relationAutoloadContext\";N;s:10:\"timestamps\";b:1;s:13:\"usesUniqueIds\";b:0;s:9:\"\0*\0hidden\";a:0:{}s:10:\"\0*\0visible\";a:0:{}s:11:\"\0*\0fillable\";a:3:{i:0;s:15:\"nama_kepala_upt\";i:1;s:4:\"foto\";i:2;s:8:\"sambutan\";}s:10:\"\0*\0guarded\";a:1:{i:0;s:1:\"*\";}}', 1766376501),
('upt_ptkk_cache_landing_beritas', 'O:39:\"Illuminate\\Database\\Eloquent\\Collection\":2:{s:8:\"\0*\0items\";a:4:{i:0;O:17:\"App\\Models\\Berita\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:7:\"beritas\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:9:{s:2:\"id\";i:2;s:5:\"title\";s:85:\"Tingkatkan Keahlian Siswa Double Track, SMAN 1 Soko Tuban Kunjungan Kerja ke UPT PTKK\";s:4:\"slug\";s:84:\"tingkatkan-keahlian-siswa-double-track-sman-1-soko-tuban-kunjungan-kerja-ke-upt-ptkk\";s:7:\"content\";s:4442:\"<p>KETIK, SURABAYA – Tim manajemen SMAN 1 Soko Tuban melaksanakan kunjungan kerja sama strategis ke Unit Pelaksana Teknis (UPT) Pengembangan Teknis dan Keterampilan Kejuruan (PTKK) Dinas Pendidikan Jawa Timur di Surabaya, 23 Oktober 2025.<br><br>Kegiatan ini dalam rangka memperkuat dan meningkatkan keahlian siswa yang tergabung dalam program Double Track. Kunjungan ini disambut hangat pihak UPT PTKK yang menandakan sinergi positif dalam pengembangan keterampilan vokasional siswa.<br><br>Tim SMAN 1 Soko disambut langsung Kepala Seksi Pengembangan Teknis UPT PTKK, Nur Khotimah, S.Pd., M.M. Dia didampingi jajarannya. Dalam suasana yang sangat ramah, tim SMAN 1 Soko menyampaikan maksud dan tujuan kunjungan yaitu menjalin kerja sama demi memastikan siswa Double Track mendapatkan pelatihan terbaik yang relevan dengan kebutuhan industri.<br><br>Setelah pemaparan, tim SMAN 1 Soko diajak meninjau fasilitas praktik/laboratorium yang dimiliki UPT PTKK. Laboratorium yang dikunjungi sangat beragam dan lengkap, mencakup keahlian teknis dan kreatif, di antaranya Laboratorium Pengelasan, Laboratorium Teknik Otomotif, Laboratorium Teknik Pendingin, dan Laboratorium Tata Boga.<br><br>Ada juga Laboratorium Tata Busana, Laboratorium Tata Kecantikan, Laboratorium Desain Web, Laboratorium Fotografi, Laboratorium Videografi, Laboratorium Desain Grafis, hingga Laboratorium Teknik Pemesinan.<br><br>Selain fasilitas praktik, tim juga ditunjukkan sarana pendukung lain seperti asrama, Hotel Q ta, musholla, serta ruang ramah tamah dan ruang makan yang representatif.<br>Nur Khotimah dan tim UPT PTKK memberikan wawasan mendalam mengenai kesiapan UPT PTKK dalam mendukung peningkatan keterampilan siswa SMAN 1 Soko.<br><br>\"Kami sangat terbuka dan antusias menyambut niat baik SMAN 1 Soko. Kerja sama ini adalah wujud nyata komitmen kami dalam peningkatan sumber daya manusia,” ucap Nur Khotimah.</p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:386187,&quot;height&quot;:375,&quot;href&quot;:&quot;https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png&quot;,&quot;url&quot;:&quot;https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png\"><img src=\"https://upt-ptkk.isslab.web.id/storage/konten-website/berita/content/G6W81187XbCAgdWtetQ8fqNLq6RD81pxWAB9lw3J.png\" width=\"600\" height=\"375\"><figcaption class=\"attachment__caption\"><span class=\"attachment__name\">image.png</span> <span class=\"attachment__size\">377.14 KB</span></figcaption></a></figure><br>“Kami sudah memiliki berbagai fasilitas laboratorium yang mumpuni, dan yang terpenting, kami siap mendukung pengembangan keterampilan siswa melalui Program Mobile Training Unit (MTU) yang bisa langsung \'menjemput bola\' ke sekolah, memastikan siswa SMAN 1 Soko mendapatkan bekal keahlian yang relevan dan siap kerja,\" tambahnya.<br><br>Salah satu poin penting yang disampaikan adalah adanya program Mobile Training Unit (MTU) yang siap diterjunkan langsung ke sekolah untuk memberikan pelatihan keterampilan kepada siswa.<br><br>Program ini menjadi solusi efektif dalam mendekatkan akses pelatihan vokasi berkualitas.<br><br>​\"Kunjungan ke UPT TPKK ini sangat berharga. Kami terkesan dengan kelengkapan fasilitas, mulai dari laboratorium pengelasan, teknik otomotif, hingga tata boga dan desain grafis. Melihat kesiapan dan keramahan tim UPT TPKK, terutama dengan adanya tawaran program MTU, kami semakin yakin bahwa sinergi ini akan menjadi lompatan besar bagi program Double Track SMAN 1 Soko dalam mencetak lulusan yang benar-benar terampil, kompeten, dan siap bersaing di dunia kerja maupun wirausaha,\" jelas Sumarni, SP., M.Pd Kepala SMAN 1 Soko.<br><br>Kerja sama ini diharapkan akan memberikan dampak signifikan terhadap kualitas lulusan program Double Track SMAN 1 Soko, sekaligus menjadikan siswa tidak hanya unggul secara akademik namun juga memiliki keterampilan yang matang dan siap kerja atau berwirausaha sesuai tuntutan zaman. (*)<br><br></p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQHK07X5KMRZHGZT3BY90TY.jpg\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-10-27 16:50:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:36:00\";s:10:\"updated_at\";s:19:\"2025-12-18 01:39:31\";}s:11:\"\0*\0original\";a:9:{s:2:\"id\";i:2;s:5:\"title\";s:85:\"Tingkatkan Keahlian Siswa Double Track, SMAN 1 Soko Tuban Kunjungan Kerja ke UPT PTKK\";s:4:\"slug\";s:84:\"tingkatkan-keahlian-siswa-double-track-sman-1-soko-tuban-kunjungan-kerja-ke-upt-ptkk\";s:7:\"content\";s:4442:\"<p>KETIK, SURABAYA – Tim manajemen SMAN 1 Soko Tuban melaksanakan kunjungan kerja sama strategis ke Unit Pelaksana Teknis (UPT) Pengembangan Teknis dan Keterampilan Kejurua