ma ini diharapkan akan memberikan dampak signifikan terhadap kualitas lulusan program Double Track SMAN 1 Soko, sekaligus menjadikan siswa tidak hanya unggul secara akademik namun juga memiliki keterampilan yang matang dan siap kerja atau berwirausaha sesuai tuntutan zaman. (*)<br><br></p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQHK07X5KMRZHGZT3BY90TY.jpg\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-10-27 16:50:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:36:00\";s:10:\"updated_at\";s:19:\"2025-12-18 01:39:31\";}s:10:\"\0*\0changes\";a:0:{}s:11:\"\0*\0previous\";a:0:{}s:8:\"\0*\0casts\";a:2:{s:12:\"published_at\";s:8:\"datetime\";s:12:\"is_published\";s:7:\"boolean\";}s:17:\"\0*\0classCastCache\";a:0:{}s:21:\"\0*\0attributeCastCache\";a:0:{}s:13:\"\0*\0dateFormat\";N;s:10:\"\0*\0appends\";a:0:{}s:19:\"\0*\0dispatchesEvents\";a:0:{}s:14:\"\0*\0observables\";a:0:{}s:12:\"\0*\0relations\";a:0:{}s:10:\"\0*\0touches\";a:0:{}s:27:\"\0*\0relationAutoloadCallback\";N;s:26:\"\0*\0relationAutoloadContext\";N;s:10:\"timestamps\";b:1;s:13:\"usesUniqueIds\";b:0;s:9:\"\0*\0hidden\";a:0:{}s:10:\"\0*\0visible\";a:0:{}s:11:\"\0*\0fillable\";a:6:{i:0;s:5:\"title\";i:1;s:4:\"slug\";i:2;s:7:\"content\";i:3;s:5:\"image\";i:4;s:12:\"is_published\";i:5;s:12:\"published_at\";}s:10:\"\0*\0guarded\";a:1:{i:0;s:1:\"*\";}}i:1;O:17:\"App\\Models\\Berita\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:7:\"beritas\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:9:{s:2:\"id\";i:3;s:5:\"title\";s:98:\"Dinas Pendidikan Jatim Atasi Keterbatasan Alat Praktik Sekolah dengan Program Mobile Training Unit\";s:4:\"slug\";s:98:\"dinas-pendidikan-jatim-atasi-keterbatasan-alat-praktik-sekolah-dengan-program-mobile-training-unit\";s:7:\"content\";s:2945:\"<p>Dinas Pendidikan (Dindik) Provinsi Jawa Timur melalui UPT Pengembangan Teknis dan Keterampilan Kejuruan (PTKK) memberi pelatihan kompetensi murid di Jatim lewat <em>Mobile Training Unit</em> (MTU), dengan menyasar sekolah yang belum memiliki alat praktik mumpuni, pada 22-27 September 2025.</p><p>Aries Agung Paewai Kepala Dindik Jatim menyatakan, MTU menyasar 150 murid yang tersebar di 5 cabang dinas pendidikan (cabdindik) wilayah yang ada di Jawa Timur, seperti Malang, Magetan, Kediri, Tuban, dan Nganjuk.</p><p>Kompetensi keahlian yang diajarkan adalah Programmable Logic Controller (PLC), Teknik Pendingin dan Tata Udara (TPTU), Videografi, dan Fotografi.</p><p>“Kesempatan ini bisa dimanfaatkan untuk mengimplikasikan dari materi teori akademik dengan prakteknya. Sehingga, kompetensi yang belum dimiliki murid kita, bisa terpenuhi,” katanya, Selasa (23/9/2025).</p><p>Aries mengatakan, program MTU menjadi salah satu solusi di tengah banyaknya SMK di Jatim yang memiliki keterbatasan pada sarana prasarana praktek, terutama pada kompetensi tertentu.</p><p>Dengan langkah tersbeut, pihaknya ingin agar kompetensi murid bisa sesuai dengan standart Dunia Usaha Dunia Industri (DUDI).</p><p>Pihaknya mengakui, program tersbeut masih terbatas dalam jumlah instruktur profesional untuk memberikan pelatihan, apalagi jumlah SMK Negeri di Jatim mencapai 298 lembaga, sedangkan banyak alat praktek di sekolah belum mumpuni. Oleh karena itu, program MTU sifatnya bergilir.</p><p>“Setiap pelepasan MTU ada 5 wilayah dengan 4 kompetensi yang ada kita harapkan mencapai sasaran yang ada. Seandainya punya banyak (MTU dan instruktur profesional) mungkin bisa menjamah 38 kabupatebn kota. Sedangkan tahun ini kita jangkau 15 kabupaten kota prada program ini,” ucapnya.</p><p>Dindik Jatim berencana, ke depan program MTU dengan empat kompetensi akan dipusatkan di satu Cabdindik wilayah agar pelatihan kompetensi bisa maksimal dan dan merata.</p><p>“Program ini kami harapkan dapat memberikan manfaat signifikan bagi para murid-murid sehingga akan berdampak besar pada kompetensi murid,” tuturnya.</p><p>Endang Winarsih Kepala UPT PTKK menambaghkan bahwa dalam MTU, Dindik tidak hanya memberikan pelatihan teknis, tetapi juga menghadirkan pengalaman praktis yang bisa menumbuhkan motivasi, inspirasi, serta mendorong kreativitas dan kemandirian siswa, agar lebih siap menghadapi tantangan dunia usaha dan dunia industri.</p><p>“Peserta kita bukan hanya dari SMK negeri yang kita tunjuk sebagai tempat pelatihan, tapi peserta berasal dari sekitar sekolah yang memang sangat membutuhkan peningkatan kompetensi,” jelasnya.</p><p>Seperti diketahui, titik pelatihan tersebut dipusatkan di beberapa sekolah, yakni SMKN 12 Malang, SMKN 1 Magetan, SMKN 1 Kediri, SMKN 3 Tuban, dan SMKN 1 Nganjuk.</p><p>Setiap Cabdin menjadi tuan rumah bagi 30 peserta didik dengan empat bidang kompetensi, mulai dari PLC, TPTU, videografi dan fotografi.</p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQHPZBBJYE06K3REWP56DYQ.jpg\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-09-23 13:40:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:38:09\";s:10:\"updated_at\";s:19:\"2025-12-18 12:17:25\";}s:11:\"\0*\0original\";a:9:{s:2:\"id\";i:3;s:5:\"title\";s:98:\"Dinas Pendidikan Jatim Atasi Keterbatasan Alat Praktik Sekolah dengan Program Mobile Training Unit\";s:4:\"slug\";s:98:\"dinas-pendidikan-jatim-atasi-keterbatasan-alat-praktik-sekolah-dengan-program-mobile-training-unit\";s:7:\"content\";s:2945:\"<p>Dinas Pendidikan (Dindik) Provinsi Jawa Timur melalui UPT Pengembangan Teknis dan Keterampilan Kejuruan (PTKK) memberi pelatihan kompetensi murid di Jatim lewat <em>Mobile Training Unit</em> (MTU), dengan menyasar sekolah yang belum memiliki alat praktik mumpuni, pada 22-27 September 2025.</p><p>Aries Agung Paewai Kepala Dindik Jatim menyatakan, MTU menyasar 150 murid yang tersebar di 5 cabang dinas pendidi