ri.</p><p>“Peserta kita bukan hanya dari SMK negeri yang kita tunjuk sebagai tempat pelatihan, tapi peserta berasal dari sekitar sekolah yang memang sangat membutuhkan peningkatan kompetensi,” jelasnya.</p><p>Seperti diketahui, titik pelatihan tersebut dipusatkan di beberapa sekolah, yakni SMKN 12 Malang, SMKN 1 Magetan, SMKN 1 Kediri, SMKN 3 Tuban, dan SMKN 1 Nganjuk.</p><p>Setiap Cabdin menjadi tuan rumah bagi 30 peserta didik dengan empat bidang kompetensi, mulai dari PLC, TPTU, videografi dan fotografi.</p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQHPZBBJYE06K3REWP56DYQ.jpg\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-09-23 13:40:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:38:09\";s:10:\"updated_at\";s:19:\"2025-12-18 12:17:25\";}s:10:\"\0*\0changes\";a:0:{}s:11:\"\0*\0previous\";a:0:{}s:8:\"\0*\0casts\";a:2:{s:12:\"published_at\";s:8:\"datetime\";s:12:\"is_published\";s:7:\"boolean\";}s:17:\"\0*\0classCastCache\";a:0:{}s:21:\"\0*\0attributeCastCache\";a:0:{}s:13:\"\0*\0dateFormat\";N;s:10:\"\0*\0appends\";a:0:{}s:19:\"\0*\0dispatchesEvents\";a:0:{}s:14:\"\0*\0observables\";a:0:{}s:12:\"\0*\0relations\";a:0:{}s:10:\"\0*\0touches\";a:0:{}s:27:\"\0*\0relationAutoloadCallback\";N;s:26:\"\0*\0relationAutoloadContext\";N;s:10:\"timestamps\";b:1;s:13:\"usesUniqueIds\";b:0;s:9:\"\0*\0hidden\";a:0:{}s:10:\"\0*\0visible\";a:0:{}s:11:\"\0*\0fillable\";a:6:{i:0;s:5:\"title\";i:1;s:4:\"slug\";i:2;s:7:\"content\";i:3;s:5:\"image\";i:4;s:12:\"is_published\";i:5;s:12:\"published_at\";}s:10:\"\0*\0guarded\";a:1:{i:0;s:1:\"*\";}}i:2;O:17:\"App\\Models\\Berita\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:7:\"beritas\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:9:{s:2:\"id\";i:1;s:5:\"title\";s:60:\"Dindik Jatim Dorong Sertifikasi Kompetensi bagi Murid Vokasi\";s:4:\"slug\";s:60:\"dindik-jatim-dorong-sertifikasi-kompetensi-bagi-murid-vokasi\";s:7:\"content\";s:1693:\"<p>Surabaya (beritajatim.com) – Dinas Pendidikan Jawa Timur (Dindik Jatim) terus mendorong peningkatan kompetensi siswa vokasi melalui pelatihan dan sertifikasi. Selama setahun, pelatihan digelar enam kali oleh UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) Dindik Jatim, menggandeng Lembaga Sertifikasi Kompetensi (LKS) Dirjen Vokasi Kemendikdasmen.&nbsp;<br><br></p><p>Kepala Dindik Jatim Aries Agung Paewai menekankan pentingnya sertifikasi bagi lulusan vokasi yang belum memiliki fasilitas praktik memadai. “Harapan kita kalau bisa seluruh lulusan vokasi memiliki pengakuan atau sertifikasi atas kompetensi mereka,” ujarnya, Jumat (8/8/2025). Ia menambahkan, pelatihan melibatkan praktisi dunia usaha dan industri agar materi yang diberikan sesuai kebutuhan lapangan. “Kita prioritaskan bagi murid yang belum mendapatkan ilmu di satuan pendidikan,” tegasnya.&nbsp;</p><p>Pada semester kedua ini, UPT PTKK menggelar pelatihan untuk kelas Milenial Job Center (MJC) angkatan 2 yang berlangsung 31 Juli-5 Agustus 2025.&nbsp;</p><p>Kepala UPT PTKK Endang Winarsih menjelaskan, peserta kelas MJC dibekali keterampilan bidang TI seperti pemrograman, pengembangan web/mobile, serta Desain Web, Desain Grafis, Animasi, Fotografi, dan Videografi. “Kita harapkan peserta memiliki motivasi untuk berinovasi dan melihat peluang dalam menciptakan solusi digital,” kata Endang. Ia menegaskan pentingnya membangun ekosistem pendidikan vokasi yang adaptif dan kompetitif.&nbsp;</p><p>Setiap kelas diikuti 15 peserta. Sertifikasi menjadi bagian dari capaian akhir pelatihan. “Seluruh murid juga mendapatkan pengakuan atas skill mereka,” pungkas Endang.<strong>&nbsp;</strong></p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQY7MGG2Z0N5QE3WDAKXKJ1.png\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-08-08 07:54:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:30:25\";s:10:\"updated_at\";s:19:\"2025-12-18 12:16:58\";}s:11:\"\0*\0original\";a:9:{s:2:\"id\";i:1;s:5:\"title\";s:60:\"Dindik Jatim Dorong Sertifikasi Kompetensi bagi Murid Vokasi\";s:4:\"slug\";s:60:\"dindik-jatim-dorong-sertifikasi-kompetensi-bagi-murid-vokasi\";s:7:\"content\";s:1693:\"<p>Surabaya (beritajatim.com) – Dinas Pendidikan Jawa Timur (Dindik Jatim) terus mendorong peningkatan kompetensi siswa vokasi melalui pelatihan dan sertifikasi. Selama setahun, pelatihan digelar enam kali oleh UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) Dindik Jatim, menggandeng Lembaga Sertifikasi Kompetensi (LKS) Dirjen Vokasi Kemendikdasmen.&nbsp;<br><br></p><p>Kepala Dindik Jatim Aries Agung Paewai menekankan pentingnya sertifikasi bagi lulusan vokasi yang belum memiliki fasilitas praktik memadai. “Harapan kita kalau bisa seluruh lulusan vokasi memiliki pengakuan atau sertifikasi atas kompetensi mereka,” ujarnya, Jumat (8/8/2025). Ia menambahkan, pelatihan melibatkan praktisi dunia usaha dan industri agar materi yang diberikan sesuai kebutuhan lapangan. “Kita prioritaskan bagi murid yang belum mendapatkan ilmu di satuan pendidikan,” tegasnya.&nbsp;</p><p>Pada semester kedua ini, UPT PTKK menggelar pelatihan untuk kelas Milenial Job Center (MJC) angkatan 2 yang berlangsung 31 Juli-5 Agustus 2025.&nbsp;</p><p>Kepala UPT PTKK Endang Winarsih menjelaskan, peserta kelas MJC dibekali keterampilan bidang TI seperti pemrograman, pengembangan web/mobile, serta Desain Web, Desain Grafis, Animasi, Fotografi, dan Videografi. “Kita harapkan peserta memiliki motivasi untuk berinovasi dan melihat peluang dalam menciptakan solusi digital,” kata Endang. Ia menegaskan pentingnya membangun ekosistem pendidikan vokasi yang adaptif dan kompetitif.&nbsp;</p><p>Setiap kelas diikuti 15 peserta. Sertifikasi menjadi bagian dari capaian akhir pelatihan. “Seluruh murid juga mendapatkan pengakuan atas skill mereka,” pungkas Endang.<strong>&nbsp;</strong></p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQY7MGG2Z0N5QE3WDAKXKJ1.png\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-08-08 07:54:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:30:25\";s:10:\"updated_at\";s:19:\"2025-12-18 12:16:58\";}s:10:\"\0*\0changes\";a:0:{}s:11:\"\0*\0previous\";a:0:{}s:8:\"\0*\0casts\";a:2:{s:12:\"published_at\";s:8:\"datetime\";s:12:\"is_published\";s:7:\"boolean\";}s:17:\"\0*\0classCastCache\";a:0:{}s:21:\"\0*\0attributeCastCache\";a:0:{}s:13:\"\0*\0dateFormat\";N;s:10:\"\0*\0appends\";a:0:{}s:19:\"\0*\0dispatchesEvents\";a:0:{}s:14:\"\0*\0observables\";a:0:{}s:12:\"\0*\0relations\";a:0:{}s:10:\"\0*\0touches\";a:0:{}s:27:\"\0*\0relationAutoloadCallback\";N;s:26:\"\0*\0relationAutoloadContext\";N;s:10:\"timestamps\";b:1;s:13:\"usesUniqueIds\";b:0;s:9:\"\0*\0hidden\";a:0:{}s:10:\"\0*\0visible\";a:0:{}s:11:\"\0*\0fillable\";a:6:{i:0;s:5:\"title\";i:1;s:4:\"slug\";i:2;s:7:\"content\";i:3;s:5:\"image\";i:4;s:12:\"is_published\";i:5;s:12:\"published_at\";}s:10:\"\0*\0guarded\";a:1:{i:0;s:1:\"*\";}}i:3;O:17:\"App\\Models\\Berita\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:7:\"beritas\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:9:{s:2:\"id\";i:4;s:5:\"title\";s:66:\"Dindik Jatim Genjot Pelatihan Vokasi demi Cetak Lulusan Siap Kerja\";s:4:\"slug\";s:66:\"dindik-jatim-genjot-pelatihan-vokasi-demi-cetak-lulusan-siap-kerja\";s:7:\"content\";s:2515:\"<p>jatim.jpnn.com, SURABAYA - Dinas Pendidikan Jatim terus menggenjot peningkatan kompetensi siswa dan guru SMK melalui pelatihan vokasi berskala besar. Dalam setahun, UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) menggelar enam kali pelatihan yang menyasar siswa dan guru produktif. Pelatihan ini menggandeng Lembaga Sertifikasi Kompetensi (LSK) dari Ditjen Vokasi Kemendikdasmen. Tujuannya untuk mencetak lulusan vokasi yang terampil, bersertifikasi, dan siap bersaing di dunia kerja maupun dunia industri (DUDI). Kepala Dindik Jatim Aries Agung Paewai mengatakan pelatihan intensif ini menjadi tolok ukur keterampilan siswa. Apalagi peserta dibimbing langsung oleh para praktisi industri dan ahli di bidangnya.</p><p>\"Harapan kami kalau bisa seluruh lulusan vokasi utamanya yang belum memiliki fasilitas bengkel praktek yang memadai bisa memiliki pengakuan atau sertifikasi atas kompetensi mereka karena ke depan, industri akan berkembang pesat seiring dengan berkembangnya teknologi,\" ujar Aries, Kamis (7/8). Dia menambahkan, sertifikasi ini penting agar lulusan vokasi memiliki daya saing, terutama menghadapi perkembangan industri dan teknologi yang terus melaju cepat. “Kita prioritaskan peserta dari sekolah yang belum punya sarpras lengkap atau belum tersentuh keterampilan sesuai kebutuhan industri. Di sinilah peran pelatihan vokasi sebagai jembatan,\" katanya.<br><br>Sementara itu, Kepala UPT PTKK Dindik Jatim Endang Winarsih menjelaskan pelatihan semester kedua ini difokuskan pada kelas Milenial Job Center (MJC) Angkatan 2 Tahun 2025 yang digelar pada 31 Juli–5 Agustus. Kelas MJC dirancang untuk siswa SMA/SMK yang memiliki dasar kemampuan di bidang pemrograman, pengembangan aplikasi web atau mobile, hingga teknologi informasi lainnya.<br>\"Peserta didorong agar mampu berinovasi dan melihat peluang menciptakan solusi digital. Harapannya mereka tak hanya siap kerja, tetapi juga bisa menjadi wirausahawan,\" jelas Endang.<br>Menurut dia, pelatihan ini juga menjadi bagian dari upaya membentuk ekosistem pendidikan vokasi yang adaptif, terstandar, dan kompetitif menuju Generasi Emas 2045. Adapun bidang keterampilan yang diajarkan dalam pelatihan MJC Reguler Angkatan 2 ini meliputi Desain Web, Desain Grafis, Motion Graphic, Animasi, Fotografi, dan Videografi. Setiap kelas diikuti 15 peserta. \"Melalui pelatihan ini, kami harapkan murid-murid bisa mendapat sertifikasi yang mengakui keahlian mereka. Itulah target akhir pelatihan vokasi,\" pungkas Endang. (mcr12/jpnn)<br><br></p>\";s:5:\"image\";s:62:\"konten-website/berita/thumbnail/01KCQHYFSQGYE8FV3JBPWXMDR1.jpg\";s:12:\"is_published\";i:1;s:12:\"published_at\";s:19:\"2025-08-07 18:40:00\";s:10:\"created_at\";s:19:\"2025-12-18 01:42:15\";s:10:\"updated_at\";s:19:\"2025-12-18 01:42:15\";}s:11:\"\0*\0original\";a:9:{s:2:\"id\";i:4;s:5:\"title\";s:66:\"Dindik Jatim Genjot Pelatihan Vokasi demi Cetak Lulusan Siap Kerja\";s:4:\"slug\";s:66:\"dindik-jatim-genjot-pelatihan-vokasi-demi-cetak-lulusan-siap-kerja\";s:7:\"content\";s:2515:\"<p>jatim.jpnn.com, SURABAYA - Dinas Pendidikan Jatim terus menggenjot peningkatan kompetensi siswa dan guru SMK melalui pelatihan vokasi berskala besar. Dalam setahun, UPT Pengembangan Teknis Keterampilan dan Kejuruan (PTKK) menggelar enam kali pelatihan yang menyasar siswa dan guru produktif. Pelatihan ini menggandeng Lembaga Sertifikasi Kompetensi (LSK) dari Ditjen Vokasi Kemendikdasmen. Tujuannya untuk mencetak lulusan vokasi yang terampil, bersertifikasi, dan siap bersaing di dunia kerja maupun dunia industri (DUDI). Kepala Dindik Jatim Aries Agung Paewai mengatakan pelatihan intensif ini menjadi tolok ukur keterampilan siswa. Apalagi peserta dibimbing langsung oleh para praktisi industri dan ahli di bidangnya.</p><p>\"Harapan kami kalau bisa seluruh lulusan vokasi utamanya yang belum memiliki fasilitas bengkel praktek yang memadai bisa memiliki pengakuan atau sertifikasi atas kompetensi mereka karena ke depan, industri akan berkembang pesat seiring dengan berkembangnya teknologi,\" ujar Aries, Kamis (7/8). Dia menambahkan, sertifikasi ini penting agar lulusan vokasi memiliki daya saing, terutama menghadapi perkembangan industri dan tekno