INSERT INTO `cerita_kamis` (`id`, `image`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(1, 'cerita-kami/01KCQJZAXRHRHXDNJ0SPEJW6XS.png', NULL, '<p>UPT PTKK merupakan salah satu Unit Pelaksana Teknis di bawah Dinas Pendidikan Provinsi Jawa Timur yang memiliki tugas dan fungsi dalam menyediakan fasilitas pelatihan berbasis kompetensi. Sebagai pelopor pelatihan vokasi, lembaga ini terus memperkuat perannya melalui penyelenggaraan program-program yang relevan, progresif, dan berdampak nyata.<br><br>Selain itu UPT PTKK diberi kepercayaan oleh Lembaga Sertifikasi Kompetensi (LSK) berbasis KKNI dibawah naungan KEMENDIKBUD Vokasi sebagai Tempat Uji Kompetensi (TUK) bidang keahlian sebagai berikut :</p><p>1.&nbsp; Tata Boga</p><p>2.&nbsp; Tata Busana</p><p>3.&nbsp; Tata Kecantikan</p><p>4.&nbsp; Teknik Elektronika</p><p>5.&nbsp; Teknik Otomotif</p><p>6.&nbsp; Fotografi</p><p>7.&nbsp; Teknik Informasi Komunikasi (Web Desain/RPL, Desain Grafis, Animasi, Konten Kreator/Videografi )</p>', '2025-12-18 02:00:11', '2025-12-22 10:11:06');
