INSERT INTO `kepala_upts` (`id`, `nama_kepala_upt`, `foto`, `sambutan`, `created_at`, `updated_at`) VALUES
(1, 'ENDANG WINARSIH, S.SOS, M.SI', 'konten-website/kepala-upt/01KCT30TP6SN8JVKETCTNVKZA4.png', '<p>Puji syukur ke hadirat Tuhan Yang Maha Esa atas limpahan rahmat-Nya sehingga UPT PTKK dapat melaksanakan setiap program pelatihan dengan baik. Program pelatihan kami disusun sebagai wujud nyata komitmen UPT PTKK dalam mendukung kebijakan Merdeka Belajar dan perubahan paradigma pendidikan vokasi agar selaras dengan kebutuhan industri,&nbsp; khususnya dalam meningkatkan kompetensi guru dan siswa di pendidikan kejuruan Jawa Timur.<br><br>Kami menyadari bahwa pencapaian tujuan besar ini tidak dapat terwujud tanpa kerja sama dan dukungan dari berbagai pihak, baik internal Dinas Pendidikan maupun eksternal. Untuk itu, kami mengucapkan terima kasih atas segala bentuk dukungan dan kontribusi yang telah diberikan. Semoga program pelatihan kami dapat menjadi landasan kuat dalam menciptakan SDM vokasi yang unggul, adaptif, kompetitif serta mampu membawa pendidikan kejuruan Jawa Timur semakin maju.&nbsp;</p>', '2025-12-18 01:24:15', '2025-12-19 08:19:06');
INSERT INTO `kompetensi` (`id`, `nama_kompetensi`, `deskripsi`, `kode`, `kelas_keterampilan`, `gambar`, `created_at`, `updated_at`) VALUES
(1, 'Tata Boga', 'Kelas Tata Boga dirancang untuk membekali peserta dengan pengetahuan dan keterampilan mengolah berbagai jenis makanan pastry. Peserta akan mempelajari teknik dasar seperti persiapan bahan, pengolahan, penyajian, hingga dekorasi hidangan. Peserta juga akan dibekali pengetahuan tentang keamanan pangan dan pengaturan porsi sehingga dapat menghasilkan hidangan yang sehat, higienis, dan bercita rasa tinggi.', 'TTBG', '1', 'kompetensi-images/01KCQH613TQHXPMMDJ6DM7Z950.png', NULL, '2025-12-20 12:22:38'),
(2, 'Tata Busana', 'Kelas Tata Busana dirancang untuk membekali peserta dengan beberapa keterampilan mulai dari pengenalan bahan dan alat, dasar-dasar menjahit, mendesain pakaian, teknik pembuatan pola, hingga finishing yang rapi dan profesional. Peserta juga akan mempelajari trend mode, perpaduan warna, dan kreativitas desain agar mampu menghasilkan karya busana yang unik dan berkualitas.', 'TTBS', '1', 'kompetensi-images/01KCQH762PCTRDPDNKMEYX86DJ.png', NULL, '2025-12-20 12:20:12'),
(3, 'Kecantikan', 'Kelas Tata Kecantikan dirancang untuk membekali peserta dengan keterampilan dasar dan lanjutan di bidang perawatan wajah, tata rias (make-up), hingga perawatan rambut. Kegiatan ini peserta diharapkan mampu mengembangkan kreativitas, menjaga etika profesi, dan memanfaatkan peluang usaha.', 'KCAN', '1', 'kompetensi-images/01KCQHC4R4GQYVAMC8MRY90DME.png', NULL, '2025-12-18 01:32:14'),
(4, 'Teknik Pendingin dan Tata Udara', 'Kelas TPTU ini dirancang untuk membekali peserta dengan pengetahuan dan keterampilan teknis mulai dari prinsip kerja sistem pendingin, komponen utama, teknik instalasi, hingga perawatan dan perbaikan peralatan pendingin. Peserta juga akan diajarkan cara mendiagnosis kerusakan, menghitung beban pendingin, serta memahami prosedur keselamatan kerja dan penggunaan alat ukur khusus.', 'TPTU', '1', 'kompetensi-images/01KCQHENHYNFM4QGRG2CFH2GD5.jpeg', NULL, '2025-12-18 01:33:38'),
(5, 'Web Desain', 'Pelatihan ini dirancang untuk memberikan pemahaman menyeluruh mengenai prinsip desain web, mulai dari dasar-dasar HTML, CSS, dan JavaScript hingga penerapan desain responsif yang ramah pengguna. Peserta juga akan diajak untuk menguasai tools pendukung seperti Figma atau Canva, serta teknik optimasi website agar lebih cepat, menarik, dan mudah ditemukan di mesin pencari.', 'WBDS', 'Milenial Job Center (MJC)', 'kompetensi-images/01KCQHNA9ZAQK7V6CGJBHDE1R2.jpg', NULL, '2025-12-18 01:37:15'),
(6, 'Desain Grafis', 'Kelas Desain Grafis dirancang untuk membekali peserta dengan pengetahuan dan keterampilan mulai dari konsep dasar desain, teori warna, tipografi, hingga teknik layout yang menarik. Peserta akan diperkenalkan pada berbagai software desain populer seperti Adobe Photoshop, Illustrator, dan aplikasi desain berbasis web seperti Canva atau Figma, sehingga dapat menghasilkan karya yang profesional.', 'DSGF', 'Milenial Job Center (MJC)', 'kompetensi-images/01KCQHQ8NXP0P4169DBQBCRNDT.jpg', NULL, '2025-12-18 01:38:18'),
(7, 'Animasi', 'Kelas animasi adalah tempat di mana peserta bisa belajar membuat gambar bergerak, mulai dari konsep dasar hingga teknik profesional. Kelas ini bisa membantu peserta mewujudkan ide menjadi sebuah karya visual, baik untuk film, video game, iklan, maupun media lainnya.', 'ANMS', 'Milenial Job Center (MJC)', 'kompetensi-images/01KCQHRQCGK4D5F3T6DFNB5V5N.jpg', NULL, '2025-12-18 01:39:07'),
(8, 'Fotografi', 'Kelas Fotografi dirancang untuk memberikan pemahaman menyeluruh mulai dari teknik dasar pengambilan gambar, pengaturan kamera, komposisi objek, hingga pencahayaan. Selain itu, peserta juga akan mempelajari proses editing menggunakan software seperti Adobe Lightroom atau Photoshop, untuk memaksimalkan hasil foto agar terlihat lebih tajam, indah, dan profesional.', 'FTGR', 'Milenial Job Center (MJC)', 'kompetensi-images/01KCQHSSX2T5408YHQRX2MXXQB.png', NULL, '2025-12-20 12:23:36'),
(9, 'Videografi', 'Kelas videografi menjadi tempat ideal untuk mengubah minat menjadi keahlian profesional. Di dalamnya, peserta tidak hanya belajar teori, tetapi juga praktik langsung untuk menguasai setiap tahapan produksi video. Dengan bimbingan mentor dan praktik langsung, peserta bisa mengubah ide menjadi karya video yang tidak hanya indah, tetapi juga mampu menyentuh hati penonton.', 'VDGR', 'Milenial Job Center (MJC)', 'kompetensi-images/01KCQHTT7VPBJP59NVSTKA67FY.jpg', NULL, '2025-12-18 01:40:15'),
(10, 'Programmable Logic Controller', 'Pelatihan Programmable Logic Controller (PLC) dirancang untuk membekali peserta dengan kemampuan mengoperasikan dan memprogram sistem otomasi industri. Peserta akan mempelajari dasar-dasar PLC, pengenalan input dan output, serta pembuatan program menggunakan ladder diagram. Selain itu, pelatihan ini mencakup praktik langsung pengendalian motor, sensor, dan sistem otomatis lainnya dengan memperhatikan standar keselamatan kerja. Kompetensi ini bertujuan meningkatkan kesiapan peserta dalam menghadapi kebutuhan industri berbasis otomasi.', 'PLC', '1', 'kompetensi-images/01KCQJTYYCYSBAEMJTERVXN5RN.jpg', NULL, '2025-12-18 01:57:48'),
(12, 'Teknik Pemesinan', 'Peserta pelatihan akan diperkenalkan pada berbagai mesin vital seperti mesin bubut untuk membentuk benda silinder, mesin frais untuk membuat permukaan datar dan alur, untuk menghasilkan produk yang sangat presisi. Peserta pelatihan juga akan mengasah kemampuan dalam membaca gambar teknik, dan merancang komponen, mulai dari mur dan baut hingga bagian-bagian rumit dari sebuah mesin besar.', 'TPM', '1', 'kompetensi-images/01KCQHZ3C44V60GS27JBSSFQ50.png', NULL, '2025-12-18 01:42:35'),
(13, 'Teknik Otomotif', 'Kelas otomotif mempelajari segala hal, mulai dari bagaimana bensin diubah menjadi tenaga, hingga bagaimana sensor-sensor canggih pada mobil modern bekerja. Di sini, tidak hanya duduk mendengarkan teori, melainkan langsung turun ke bengkel, memegang kunci pas, dan merasakan langsung setiap komponen.', 'TOTO', '1', 'kompetensi-images/01KCQJ15CNF5DAA383WVD8S1NB.png', NULL, '2025-12-18 01:43:43'),
(14, 'Teknik Pengelasan', 'Peserta akan mempelajari cara menggunakan berbagai teknik las, mulai dari Las SMAW (Shielded Metal Arc Welding) yang paling umum, Las GMAW (Gas Metal Arc Welding) untuk kecepatan dan efisiensi, hingga Las GTAW (Gas Tungsten Arc Welding) yang dikenal karena hasilnya yang sangat rapi. Peserta juga akan diajarkan cara mempersiapkan material, memilih kawat las yang sesuai, mengatur arus listrik dengan benar, serta memastikan keselamatan saat bekerja.', 'TLAS', '1', 'kompetensi-images/01KCQJ67MC2FAKPTSPJRWHBE75.png', NULL, '2025-12-18 01:46:29');
