INSERT INTO `konten_program_pelatihans` (`id`, `judul`, `deskripsi`, `hero_image`, `galeri`, `created_at`, `updated_at`) VALUES
(1, 'Mobil Training Unit', 'Mobil Keliling UPT. PTKK Dinas Pendidikan Jawa Timur adalah sebuah program unggulan yang dirancang khusus untuk menjangkau sekolah di pelosok-pelosok Jawa Timur. Mobil ini bukan sekadar kendaraan biasa, melainkan sebuah bengkel pendidikan dan ruang kelas berjalan yang dilengkapi dengan peralatan modern. Di dalamnya, para instruktur profesional siap memberikan pelatihan keterampilan di seluruh Jawa Timur.', 'konten-website/program-pelatihan/hero/01KCQJAEG0C6RBESFCMMGGPX6Y.png', '[\"konten-website/program-pelatihan/galeri/01KCQJAEG1R9556D42TC6MVFFX.png\", \"konten-website/program-pelatihan/galeri/01KCQJAEG1R9556D42TC6MVFFY.png\", \"konten-website/program-pelatihan/galeri/01KCQJAEG25VN6Z9K87EETVG1B.png\"]', '2025-12-18 01:48:47', '2025-12-18 01:48:47'),
(2, 'Diklat Peningkatan Kompetensi', 'Proses peningkatan kompetensi di UPT. PTKK dipandu oleh para asesor kompetensi profesional yang telah tersertifikasi.  Ini adalah bukti nyata komitmen Pemerintah Provinsi Jawa Timur membangun sumber daya manusia yang unggul dan siap menghadapi tantangan global dan menjadi garda terdepan yang menjamin mutu sumber daya manusia di Jawa Timur.', 'konten-website/program-pelatihan/hero/01KCQJDQ751JD23BR7MM7HBJQ3.png', '[\"konten-website/program-pelatihan/galeri/01KCQJDQ762QGSMZGBRW3JCGBP.png\", \"konten-website/program-pelatihan/galeri/01KCQJDQ762QGSMZGBRW3JCGBQ.png\", \"konten-website/program-pelatihan/galeri/01KCQJDQ77EACN1EZJ91M8GHNK.png\"]', '2025-12-18 01:50:35', '2025-12-18 01:50:35'),
(3, 'Sertifikasi Berbasis KKNI Bertaraf Nasional', 'UPT PTKK memiliki 7 kompetensi yang tersertifikasi oleh Kemendikdasmen sebagai tempat uji kompetensi yang memiliki fasilitas mumpuni. Dari TUK UPT PTKK dipercaya mengembang 10 skema kompetensi, yang mana akan mengantarkan para peserta pelatihan baik guru dan siswa untuk memperoleh pengakuan kompetensi mereka dengan standar nasional.', 'konten-website/program-pelatihan/hero/01KCQJJ07STTHHP19BXX31F8SY.png', '[\"konten-website/program-pelatihan/galeri/01KCQJJ07T8245TWRQYXYJQCE0.jpg\", \"konten-website/program-pelatihan/galeri/01KCQJJ07T8245TWRQYXYJQCE1.jpg\", \"konten-website/program-pelatihan/galeri/01KCQJJ07VYMKF7J250V8PD625.jpg\"]', '2025-12-18 01:52:55', '2025-12-18 01:52:55');
